import React from 'react';
import useWebAnimations, {zoomInUp} from "@wellyshen/use-web-animations";
import './header.css';
function Header(){
    const { keyframes, timing } = zoomInUp;
    const { ref } = useWebAnimations({
      keyframes,
      timing: {
          iterations: Infinity
      },
    });
    return(
        <header className="header" >
            <h1  className="logo" ref={ref}><a href="/">BOOTCAMP 2020</a></h1>
        </header>
    )
};
export default Header;
